def exp_smooth(coord_x,coord_y,path, alf):
    # disp_list= disp_pix(coord_x,coord_y,r"C:\Users\user\PycharmProjects\phase_wm\extract")
    # disp_list.insert(0,0)
    # print(disp_list)
    cnt = 0
    count = 3000

    diff_val=np.array([])
    pix_val = np.array([])
    smooth_val = np.array([])
    arr_copy = np.asarray([])

    for scene in range(1,len(disp_list)):
        cnt = disp_list[scene-1]
        while cnt < disp_list[scene]:

            arr = io.imread(path + r'\frame' + str(cnt) + ".png")[coord_x,coord_y,0]
            pix_val = np.append(pix_val, arr)
